import React from 'react'
import { Navigate } from 'react-router-dom'
import { AuthConsumer } from '../helper/AuthContext'
import Home from '../pages/Home'

function DefineRoute({ children }) {
    return (
        <AuthConsumer>
            {({ isAuth }) => (
                <>
                    {isAuth
                        ? () => {
                              return <Home />
                          }
                        : (children) => {
                              children
                          }}
                </>
            )}
        </AuthConsumer>
    )
}

export default DefineRoute
